Votre demande de règlement a été sélectionnée au hasard pour un examen de vérification. Une intervention immédiate de votre part est requise. Vous devez répondre à %1$s dans les 30 prochains jours. SVP suivre les étapes ci-après :

 • Ouvrir une session aux Services en ligne des membres du régime de %2$s à greenshield.ca;
 • Une fois la session ouverte, un message d'avis de rappel de vérification sera immédiatement affiché;
 • Cliquer sur «Visualiser la liste de vérifications» pour voir votre (vos) vérification(s) de demande de règlement en instance;
 • Cliquer sur le numéro du formulaire en question pour voir les détails de la vérification;
 • Télécharger de façon pratique en ligne votre facture et toute autre documentation justificative (comme une ordonnance, le cas échéant).
 • Ou, vous pouvez imprimer le formulaire d'avis de vérification et l'envoyer par la poste, accompagné de la documentation requise, à l'adresse indiquée au bas de la page d'avis.
